com.mirth.connect.plugins.javascriptstep.script:
logger.info('Extrae CDA del Request HTTP ....');
logger.info("msg " + msg);
logger.info("content " + msg['Content']);

// sobre-escribe el mensaje del canal
msg = new XML(msg['Content'].toString());

logger.info("children " + msg.children());
logger.info("recordTarget " + msg['recordTarget']);
logger.info("typeId " + msg['typeId']);
logger.info("id " + msg['id']['@root']);

// En el paso anterior la variable nombre_paciente se puso en el channelMap
// Eeste código debería mostar el nombre del paciente en la consola de canales

logger.info( channelMap.get('nombre_paciente') );
logger.info( channelMap.get('id_paciente') );
logger.info( channelMap.get('nombre_medico') );
logger.info( channelMap.get('fecha_documento') );

// Transforma el string 2012-06-12 09:59:00 +0300 en un Date de Java:
var formatter = new java.text.SimpleDateFormat("yyyy-MM-dd hh:mm:ss X");
var date = formatter.parse( channelMap.get('fecha_documento') );

//logger.info( "date java: "+ date );

// Para guardar en MySQL llevamos la fecha con zona horaria -0300 a UTC (+0000).
// Porque MySQL no guarda zonas horarias, y es fácil estandarizar todo a UTC.
var mySQLFormatter = new java.text.SimpleDateFormat("yyyy-MM-dd hh:mm:ss");
mySQLFormatter.setTimeZone(java.util.TimeZone.getTimeZone("UTC"));
var fecha_documento = mySQLFormatter.format( date );

//logger.info( "date java mysql: "+ fecha_documento );
channelMap.put('fecha_documento', fecha_documento); // Ahora con formato aceptado por MySQL


// Timestamp con formato MySQL (fecha y horas actuales)
//var timestamp = DateUtil.formatDate( "yyyy-MM-dd HH:mm:ss", new Date() ); // Zona horaria implícita a la actual
var timestamp = mySQLFormatter.format( new java.util.Date() ); // Con zona horaria UTC
channelMap.put('timestamp', timestamp);

