com.mirth.connect.plugins.javascriptstep.script:
var action = msg['Parameters']['action'].toString()

logger.info('action: '+ action);

// Extrae el mensaje del Request HTTP
msg = new XML(msg['Content'].toString());

logger.info(msg);

var value = msg['persona']['nombre'];

if (action == "upper")
  value = Packages.paquete.Servicio.toUpper(value);
else if (action == "lower")
  value = Packages.paquete.Servicio.toLower(value);

// Nombre transformado
msg['persona']['nombre'] = value;


// Usando un servicio para obtener el largo, debe ser igual al largo
if (msg['persona']['nombre'].toString().length == Packages.paquete.Servicio.size(msg['persona']['nombre'].toString()))
{
   logger.info('largo de JS y Java son iguales');
}
else logger.info('largo de JS y Java NO son iguales');

