{
   logger.info("Rutea a Hospital A");
   router.routeMessageByChannelId(globalMap.get('C04_router_hosp_a'), msg_str);
}
else
{
   logger.info("Rutea a Hospital B");
   router.routeMessageByChannelId(globalMap.get('C04_router_hosp_b'), msg_str);
}

